import BullContainer from "./BullContainer";

const BullRow = (props) => {
    return(
        <div className="row">
           {props.upperStocks.map(data => {
                  <div tabIndex="0" className="upper symbol-box" data-index="${i}">
                  <h2 id="symbol">{props.name}</h2>
                  <p className="price price-up-${i}">Price: ${props.price}</p>
                  <div className="changes-row">
                    <p className="changePercentageUp-${i}">${props.percentage}%</p>
                    <img id="upArrow" src="./images/upArrow.svg"/>
                    <p>${props.change}</p>
                  </div>
                </div>
               })}    
        </div>
    )
}

export default BullRow;
